// Home.jsx
import React from 'react';
import 'swiper/swiper-bundle.min.css';
import SwiperCore, { Pagination } from 'swiper';
import { Swiper, SwiperSlide } from 'swiper/react';

SwiperCore.use([Pagination]);

const Home = () => {
    return (
        <div className="cont1">
            <p><u>E<span>vent</span>Hub</u></p>
            <div className="cont_in" id="home">
                <p>to make moments <span>beautiful...</span></p>
                <Swiper className="mySwiper" pagination={{ clickable: true }}>
                    <SwiperSlide><img src="images/shadi.jpg" alt="Event 1" /></SwiperSlide>
                    <SwiperSlide><img src="images/janeu.jpg" alt="Event 2" /></SwiperSlide>
                    <SwiperSlide><img src="images/e2.jpeg" alt="Event 3" /></SwiperSlide>
                    <SwiperSlide><img src="images/e3.jpeg" alt="Event 4" /></SwiperSlide>
                    <SwiperSlide><img src="images/e4.jpeg" alt="Event 5" /></SwiperSlide>
                    <SwiperSlide><img src="images/e5.jpeg" alt="Event 6" /></SwiperSlide>
                </Swiper>
            </div>
        </div>
    );
};

export default Home;
